import React from "react";
import User from "../assets/images/user.png"; // Importando a imagem do usuário

const Header = ({ username }) => {
  return (
    <header className="bg-white shadow-md">
      <div className="flex justify-between items-center px-6 py-4">
        <div className="text-xl font-bold">NutriHouse</div>
        <div className="flex items-center space-x-6">
          {/* Menu */}
          <nav className="space-x-4">
            <a href="/home" className="text-black">Cursos</a>
            <a href="/sobre" className="text-black">Sobre</a>
          </nav>
          {/* Saudação ao usuário com a imagem */}
          <div className="flex items-center gap-2">
            <span className="text-black">
              Olá, <strong>{username}</strong>
            </span>
            <img 
              src={User} 
              alt="User" 
              className="w-8 h-8 rounded-full" 
            />
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
